import React,{useState,useEffect} from 'react'
import { useSelector,useDispatch } from 'react-redux';
import {fetchData} from '../../actions/Seller';
import './Customer.css';
const Customer = () => {

    const dispatch = useDispatch();
    const [loading,setLoading] = useState(true);
    const seller_Details = useSelector((state) => state.allSeller);
    console.log(seller_Details);
    useEffect(() => {
        dispatch(fetchData);
    },[]);

    const l = seller_Details.length;

    return (

        <div>
               {l ? <div className='main_container'>
                    <h2>Seller Details</h2>
                    <div className='details'>
                    {seller_Details.map((seller) => {
                        return (<div key={seller._id}>
                        <p>{seller.name}</p>
                        <p>{seller.email}</p>
                        <p>{seller.number}</p>
                        <p>{seller.type}</p>
                        <p>{seller.pincode}</p>
                        </div>)
                    })}
                    </div>
                 </div>
                : <h1>Loading</h1> 
                }  


        </div>
    )
}

export default Customer
